import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Teste1 (props1) {
   
    return (
            <View style = {css.container2}>
                
                <TouchableOpacity title = "Ir para Teste1" onPress={()=>props1.navigation.navigate('Teste2')} style = {css.button2}>Teste2</TouchableOpacity>
            </View>
    );
    
}
